import (
	context "context"
	rapiddocs "github.com/literal/rapiddocs"
	rapiddocsclient "github.com/literal/rapiddocs/client"
)

client := rapiddocsclient.NewClient()
response, err := client.Headers.Send(
	context.TODO(),
	&rapiddocs.SendLiteralsInHeadersRequest{
		Query: "What is the weather today",
	},
)

